    return (
        <div className="mb-3">
            <div className="d-flex">
                <button className="color-button" checked={selected} onClick={() => setWheel(option)}></button>
                <input className="form-check-input" type="radio" checked={selected} onClick={() => setWheel(option)} />
            </div>
        </div>
    )
}

export default WheelItem;
